import './App.css';
import { useState, useEffect } from 'react';
import UserEntry from './UserEntry';
import HomePage from './HomePage'

function App() {
  const [logedIn, setLogedIn] = useState(false);
  const changeLoginState = (val)=>{
    setLogedIn(val)
  };
  return (
    <div className="App">
      { logedIn ? <HomePage setLogedIn={changeLoginState}/> : <UserEntry setLogedIn={changeLoginState} />}
    </div>
  );
}

export default App;
